James William &quot;Jimmy&quot; Buffett (born December 25, 1946) is an American singerÃ¢â‚¬â€œsongwriter, author, actor, and businessman. He is best known for his music, which often portrays an &quot;island escapism&quot; lifestyle, and the often humorous things he has experienced throughout his life. Together with his Coral Reefer Band, Buffett has recorded hit songs including &quot;Margaritaville&quot; (ranked 234th on the Recording Industry Association of America's list of &quot;Songs of the Century&quot;) and &quot;Come Monday&quot;. He has a devoted base of fans known as &quot;Parrotheads&quot;.

Aside from his career in music, Buffett is also a best-selling writer and is involved in two restaurant chains named after two of his best known songs, &quot;Cheeseburger in Paradise&quot; and &quot;Margaritaville&quot;. He owns the Margaritaville Cafe restaurant chain and co-developed the Cheeseburger in Paradise restaurant concept with OSI Restaurant Partners (parent of Outback Steakhouse), which operates the chain under a licensing agreement with Buffett.
